window.bookSummaryJSON = "<p>Shannon West refused to just move on. She wanted revenge. Luckily for her, an unexpected event put her right on the path of the voodoo priestess who could help.&nbsp;</p> <p>She gets a couple of dolls, but they come with a warning: These dolls are <i>alive</i>! Treat them well.... Feed them daily.... And <i>never</i> use on the innocent....&nbsp;</p> <p>But what happens when you decide to make your own rules? For Shannon, life with her dolls means power and success...but at what cost? See what happens when you don’t heed your warnings.... The doll just might poke you back....</p>"; 
